// https://leetcode.com/problems/maximum-xor-for-each-query/description/

// Note that the maximum possible XOR result is always 2^(maximumBit) - 1

// So the answer for a prefix is the XOR of that prefix XORed with 2^(maximumBit)-1

var getMaximumXor = function (nums, maximumBit) {
    let originalLen = nums.length
    let len = nums.length
    let final = new Array(len)
    let maxK = Math.pow(2, maximumBit) - 1

    //calculate prefix array for xorSum
    let prefix = new Array(len)
    prefix[0] = nums[0]
    for (let i = 1; i < len; i++) {
        prefix[i] = prefix[i - 1] ^ nums[i]
    }
    // loop over quesries
    for (let query = 0; query < originalLen; query++) {
        //for each iteration loop over k values to find max
        let k = prefix[len - 1] ^ maxK
        final[query] = k
        //delete last element of arr
        nums.splice(len - 1, 1)
        len--
    }
    return final
};

